import React, { useState } from 'react';
import '../Style.css';
import MapComponent from "./Map";

const ContactForm = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    message: ''
  });

  const [errors, setErrors] = useState({});
  const [isSubmitted, setIsSubmitted] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const validate = () => {
    const errors = {};
    if (!formData.name) errors.name = 'Name is required';
    if (!formData.email) {
      errors.email = 'Email is required';
    } else if (!/\S+@\S+\.\S+/.test(formData.email)) {
      errors.email = 'Email address is invalid';
    }
    if (!formData.message) errors.message = 'Message is required';
    return errors;
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const validationErrors = validate();
    if (Object.keys(validationErrors).length > 0) {
      setErrors(validationErrors);
    } else {
      // Handle form submission
      try {
        let res = await fetch("https://database-b7088-default-rtdb.firebaseio.com/Contact.json", {
          method: "POST",
          headers: {
            'Content-Type': 'application/json'
          },
          body: JSON.stringify({
            name: formData.name,
            email: formData.email,
            message: formData.message
          })
        });

        if (res.ok) {
          console.log('Form submitted:', formData);
          setIsSubmitted(true);
          setFormData({
            name: '',
            email: '',
            message: ''
          });
        } else {
          console.error('Form submission failed:', res.statusText);
        }
      } catch (error) {
        console.error('Form submission error:', error);
      }
    }
  };

  return (
    <div className="contact-form-container">
      <div className="row">
        <div className="hdn">
          <h1>CONTACT US</h1>
          <p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s.</p>
        </div>
      </div>
      <div className="row">
        <div className="col-md-6">
          {/* Form */}
          <form onSubmit={handleSubmit}>
            <div>
          {isSubmitted && <h4 style={{color:'green'}}>Thank you for your message!</h4>}

              <label htmlFor="name">Name</label>
              <input
                type="text"
                name="name"
                value={formData.name}
                onChange={handleChange}
              />
              {errors.name && <span className="error">{errors.name}</span>}
            </div>
            <div>
              <label htmlFor="email">Email</label>
              <input
                type="email"
                name="email"
                value={formData.email}
                onChange={handleChange}
              />
              {errors.email && <span className="error">{errors.email}</span>}
            </div>
            <div>
              <label htmlFor="message">Message</label>
              <textarea
                name="message"
                value={formData.message}
                onChange={handleChange}
              ></textarea>
              {errors.message && <span className="error">{errors.message}</span>}
            </div>
            <button className='btn' type="submit">Submit</button>
          </form>
        </div>
        <div className="col-md-6">
          <div className="row">
            <div className="col-md-7 col1">
              <div className="con-lt">
                <p style={{ display: 'flex' }}>
                  <img style={{ width: '21px', height: '24px' }} src={process.env.PUBLIC_URL + 'mapi.png'} alt="img" />
                  &nbsp; 1/F lorem pesum, 138 Shau &nbsp; &nbsp; &nbsp; &nbsp; Kei Road Sai Wan Ho, Dummy
                </p>
                <p>
                  <a href="tel:99-566-555-55">
                    <img src={process.env.PUBLIC_URL + 'phone.png'} alt="img" />&nbsp; +99-566-555-55
                  </a>
                </p>
                <p>
                  <a href="mailto:Example@gmail.com">
                    <img src={process.env.PUBLIC_URL + 'mail.png'} alt="img" />&nbsp; Example@gmail.com
                  </a>
                </p>
                <div className="media">
                  <img src={process.env.PUBLIC_URL + 'youtube.png'} alt="img" />
                  <img src={process.env.PUBLIC_URL + 'Instagram.png'} alt="img" />
                  <img src={process.env.PUBLIC_URL + 'Facebook.png'} alt="img" />
                  <img src={process.env.PUBLIC_URL + 'x.png'} alt="img" />
                </div>
              </div>
            </div>
            <div className="col-md-5 col1">
              <div className="fly">
                <img className='vert-move' src={process.env.PUBLIC_URL + 'fly.png'} alt="img" />
              </div>
            </div>
            <div className="map">
              <MapComponent />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ContactForm;
